(27, 508811, 4, NULL, '<p><span style=\"color: rgb(85, 85, 85); font-family: &quot;Siyam Rupali&quot;; text-align: justify;\">আমার বাংলা নিয়ে প্রথম কাজ করবার সুযোগ তৈরি হয়েছিল&nbsp;</span><span style=\"color: rgb(85, 85, 85); font-family: &quot;Siyam Rupali&quot;; text-align: justify;\">নামক এক যুগান্তকারী বাংলা সফ্‌টওয়্যার হাতে পাবার মধ্য দিয়ে। এর পর একে একে বাংলা উইকিপিডিয়া, ওয়ার্ডপ্রেস বাংলা কোডেক্সসহ বিভিন্ন বাংলা অনলাইন পত্রিকা তৈরির কাজ করতে করতে বাংলার সাথে নিজেকে বেঁধে নিয়েছি আষ্টেপৃষ্ঠে। বিশেষ করে অনলাইন পত্রিকা তৈরি করতে ডিযাইন করার সময়, সেই ডিযাইনকে কোডে রূপান্তর করবার সময় বারবার অনুভব করেছি কিছু নমুনা লেখার।</span><br></p>', '2020-11-08 12:55:29', '2020-11-08 14:30:43'),
(28, 508811, 8, '28231604840668_slider_image.png', '<p>test data</p><p>test data</p><p>test data</p><p>test data<br></p>', '2020-11-08 13:04:28', '2020-11-08 13:04:28'),
(29, 508811, 1, NULL, '<p>ডিজিটাল তথ্য বোর্ডে আপনারা আপনাদের এলাকার বন্যা ও আবহাওয়ার পূর্বাভাস পাবেন। এছাড়াও আপনাদের এলাকার বর্তমান পরিস্থিতি সম্পর্কে জানতে পারবেন।<br></p>', '2020-11-10 13:06:01', '2020-11-10 13:32:50'),
